import React from 'react';
import './Hero.css';
import logo from '../assets/logo.png';

const Hero = () => {
  return (
    <section className="hero">
      <img src={logo} alt="SLAM Fitness Studio" className="main-logo" />
    </section>
  );
};

export default Hero;
